import React from 'react'
import classes from './NewProduct.module.css'
import { connect } from 'react-redux'
import HeaderNewProduct from './HeaderNewProduct/HeaderNewProduct'
import Product from './Product/Product'
import {NewActiveSlide} from '../../redux/ProductReducer'


const NewProduct = (props) =>{
	return <section className={classes.section}>
		<HeaderNewProduct text="New Products" NewActiveSlideProduct={props.NewActiveSlideProduct} activeSlide={props.ActivePageNewProducts}/>
		<div className={classes.Products}>	
			{props.NewProducts.filter(el => el.id <= props.ActivePageNewProducts * props.LengthNewProduct && el.id > props.ActivePageNewProducts * props.LengthNewProduct - props.LengthNewProduct).map(el => { return <Product img={el.img} Prise={el.Prise} Sale={el.Sale} text={el.text} key={el.id}/>})}
		</div>
		<HeaderNewProduct text="Top Products"/>
		<div className={classes.Products}>
			{props.NewProducts.map(el => { return <Product img={el.img} Prise={el.Prise} Sale={el.Sale} text={el.text} key={el.id}/>})}
		</div>
		<HeaderNewProduct text="Sale Products"/>
		<div className={classes.Products}>
			{props.NewProducts.map(el => { return <Product img={el.img} Prise={el.Prise} Sale={el.Sale} text={el.text} key={el.id}/>})}
		</div>
	</section>
}

const mapStateToProps = (state) => {
    return{
    	LengthNewProduct:state.Products.LengthNewProduct,
    	ActivePageNewProducts:state.Products.ActivePageNewProducts,
    	NewProducts:state.Products.NewProducts,
        activeSlide:state.Slide.activeSlide
    }
}


export default connect(mapStateToProps,{NewActiveSlide})(NewProduct)
